description: |-
  [Dual-Triple Color Silk PLA Plus] SUNLU Multi Color Silk PLA Plus 3D Printer Filament, offers a mutil color printing experience with 1 single filament. Printed creations with varying colors from different angles.

  [Silky Texture, Smooth Finish] The Silk 3D filament delivers a silky, smooth texture with vibrant, eye-catching colors. Its dazzling surface requires no polishing, making every creation radiate artistic brilliance.

  [Enhanced Toughness Silk PLA+] With 50 times the toughness of regular PLA, Silk PLA+ stands out for its flexibility without breaking, impact resistance without cracking, and excellent compression strength.

  [Neatly Wound for Hassle-Free Printing] SUNLU's 3D filament is precision machine-wound, ensuring tangle-free, organized printing. The 1.75 mm filament comes with a high level of accuracy at +/- 0.02 mm, offered in 1kg (2.2 lbs) spools.

  [Reusable Vacuum-Sealed Storage] We provide full protection with durable packaging, reusable vacuum bags to block moisture, and dual desiccants. These safeguards keep your filament in perfect condition for both storage and use.

  [Recommended Settings] For best results, use a nozzle temperature of 205degreesC - 215degreesC (401degreesF - 419degreesF) and a bed temperature of 50degreesC - 65degreesC (122degreesF - 149degreesF).
